import React, { Component } from 'react'
import Person from "./Components/Person/Person.js";
import "./App.css";
class App extends Component {
  constructor (props){
    super(props);
    this.state = {
      persons: [
        {
          name: "Anas", age:10
        },
        {
          name: 'Issac', age:20
        },
        {
          name: 'React', age:30
        }
      ],
    };
  }

  render() {
    return (
      <div className='App'>
        <Person name={this.state.persons[0].name}
        age= {this.state.age[0].age}></Person>
      </div>
    );
  }
}


export default App;
